import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { select_route } from "./api";
const Error=()=>{
    const navigate=useNavigate()


    useEffect(() => {
        clearInterval()
        setInterval(()=>{select_route(navigate)},5000)


    },[]);
    return(
        <div>
            404 not found
        </div>
    )
}
export default Error;
